import React, { Component } from "react";
import { Col, Panel } from 'react-bootstrap';
import HeaderBar from './../master/HeaderBar';
import './TextAnimation.css';
import './HomePage.css';
import Book from './../img/BookIcon.svg';
import Gear from './../img/GearIcon.svg';
import WateringCan from './../img/WateringCanIcon.svg';
import Shovel from './../img/ShovelIcon.svg';
import Runner from './../img/RunnerIcon.svg';
import Airplane from './../img/AirplaneIcon.svg';

class HomePage extends Component {
    render() {
        return (
            <div>
                <HeaderBar title="JM Miller Consulting" />
                <Panel className="page-contents-panel" style={{ width: "66%", margin: "0 16%" }}>
                    <hr style={{ background: "lightblue" }} />
                    <h4>Jonathan M Miller</h4>
                    <h5>...Who?</h5>
                    <br />
                        <Col lg={3} sm={12} style={{ float: "left" }}>
                            <p className="description-thing-list" style={{ width: "100%" }}>
                                <p className="write-software"><span>I write software</span>&nbsp;&nbsp;<span className="UnderscoreIcon">&nbsp;</span></p>
                                <p className="build-things"><span>I build things</span>&nbsp;&nbsp;<img className="GearIcon" style={{width:"16px"}} src={Gear}/></p>
                                <p className="volunteer"><span>I help out</span>&nbsp;&nbsp;<img className="ShovelIcon" style={{width:"16px"}} src={Shovel}/><span></span></p>
                                {/* <p className="volunteer"><span>I help out</span>&nbsp;&nbsp;<img className="ShovelIcon" style={{width:"16px"}} src={Shovel}/><span><img className="WateringCanIcon" style={{width:"16px"}} src={WateringCan}/></span></p> */}
                                <p className="run-trails"><span>I run races</span>&nbsp;&nbsp;<span><img className="RunnerIcon" style={{width:"16px"}} src={Runner}/></span></p>
                                <p className="go-places"><span>I go places</span>&nbsp;&nbsp;<span><img className="AirplaneIcon" style={{width:"16px"}} src={Airplane}/></span></p>
                                <p className="tell-stories"><span>I tell stories</span>&nbsp;&nbsp;<span><img className="BookIcon" style={{width:"16px"}} src={Book}/></span></p>
                                <br />
                            </p>

                        </Col>
                        <Col lg={12} style={{ float: "none", clear: "both" }}>
                            <p>
                                If you're looking at this site, there's a pretty good chance that you either know me or you want to know me. Or, better yet, you're just a curious reader at the end of a trail of purple hyperlinks. 
                            </p>
                            <p>
                                In any case, I'm glad you're here and I hope you'll take a look at the work I've done and the stories I've told.
                            </p>
                        </Col>
                </Panel>
            </div>
        )
    }

}

export default HomePage;
